       double qam4(sc_bv<1> data) {
	double val = 0.0 ;
	sc_uint<1> tmp = data;
	switch (tmp)        {
		case 0: val = -1;
		break;
		case 1: val = 1;
		break;
		default : cout << "Strong noise or attenuation!" << data << "\n";
		break;
	}
	return val;
}
          double qam16(sc_bv<2> data) {
	double val = 0.0 ;
	sc_uint<2> tmp = data;
	switch (tmp)        {
		case 0: val = -3;
		break;
		case 1: val = -1;
		break;
		case 2: val = 3;
		break;
		case 3: val = 1;
		break;
		default : cout << "Strong noise or attenuation!" << data << "\n";
		break;
	}
	return val;
}
          double qam64(sc_bv<3> data) {
	double val = 0.0 ;
	sc_uint<3> tmp = data;
	switch (tmp)        {
		case 0: val = -7;
		break;
		case 1: val = -5;
		break;
		case 2: val = -1;
		break;
		case 3: val = -3;
		break;
		case 4: val = 7;
		break;
		case 5: val = 5;
		break;
		case 6: val = 1;
		break;
		case 7: val = 3;
		break;
		default : cout << "Strong noise or attenuation!" << data << "\n";
		break;
	}
	return val;
}
          double qam256(sc_bv<4> data)  {
	double val = 0.0 ;
	sc_uint<4> tmp = data;
	switch (tmp)         {
		case 0: val = -15;
		break;
		// werte noch anpassen         case 1: val = -13;
		break;
		case 2: val = -11;
		break;
		case 3: val = -9;
		break;
		case 4: val = -7;
		break;
		case 5: val = -5;
		break;
		case 6: val = -3;
		break;
		case 7: val = -1;
		break;
		case 8: val = 15;
		break;
		case 9: val = 13;
		break;
		case 10: val = 11;
		break;
		case 11: val = 9;
		break;
		case 12: val = 7;
		break;
		case 13: val = 5;
		break;
		case 14: val = 3;
		break;
		case 15: val = 1;
		break;
		default : cout << "Strong noise or attenuation!" << data << "\n";
		break;
	}
	return val;
}
         void processing() {
	for (int i = 0; i < rate_in ; i++) {
		symbol[i] = in.read(i);
	}
	switch( rate_in ) {
		case 2  : i_o = (qam4(symbol.range((rate_in/2-1),0)))  ;
		q_o = (qam4(symbol.range(rate_in-1,rate_in/2))) ;
		break ;
		case 4  : i_o = (qam16(symbol.range((rate_in/2-1),0))) ;
		q_o = (qam16(symbol.range(rate_in-1,rate_in/2))) ;
		break ;
		case 6  : i_o = (qam64(symbol.range((rate_in/2-1),0))) ;
		q_o = (qam64(symbol.range(rate_in-1,rate_in/2))) ;
		break ;
		case 8  : i_o = (qam256(symbol.range((rate_in/2-1),0)));
		q_o = (qam256(symbol.range(rate_in-1,rate_in/2)));
		break ;
		default : cout << " data rate not supported  " << endl;
		sc_core::sc_stop();
		// stop simulation         break ;
	}
	out_i.write(i_o) ;
	out_q.write(q_o) ;
}

